function initPhoneMask() {
    if (GLOBAL.enable_phone_mask_on_input && !GLOBAL.use_countries) {
        $('.j-phone').each(function() {
            var me = $(this);
            if (!me.hasClass('j-phone-masked')) {
                me.inputmask({
                    "mask": GLOBAL.phone_mask
                });
                me.addClass('j-phone-masked')
            }
        })
    } else {
        $('.j-phone').each(function() {
            var me = $(this);
            if (!me.hasClass('j-phone-masked')) {
                me.inputmask({
                    regex: '[+]?[0-9 ()\\-]*'
                });
                me.addClass('j-phone-masked')
            }
        })
    }
}
